  return (
    <>
      <Button className={styles.topButtons}>A</Button>
      <Button
        variant="primary"
        style={{ paddingLeft: "2em", paddingRight: "2em" }}
      >
        B
      </Button>
      <Button
        variant="primary"
        className="top-buttons"
        style={{ paddingLeft: "2em", paddingRight: "2em" }}
      >
        C
      </Button>
      <br />
      <br />
      <div>
        <Button>1</Button>
        <Button>2</Button>
        <Button>3</Button>
        <Button>4</Button>
        <Button>5</Button>
      </div>
    </>
  );
};
